description:
Jamie's cafe venture wasn't the dream she'd hoped. Pole dancing in the cafe she once owned, her luck seems to turn when her old boyfriend shows up and proposes. Watch this strange and sensual trail with a fortune-telling Gypsy, stag parties, a Blood Wedding and dueling suitors. A sexual adventure to remember...


